import React, { useEffect, useState } from 'react';
import { useHistory } from 'react-router-dom';

function ImagesPage() {
  const [images, setImages] = useState([]);
  const history = useHistory();

  useEffect(() => {
    fetch("http://localhost:5000/imagespage")
      .then((res) => res.json())
      .then((data) => {
        setImages(data.data);
      })
      .catch((error) => {
        console.log("Error fetching images:", error);
      });
  }, []);

  const handleImageClick = (image) => {
    // Navigate to ImageAnnotationPage with the clicked image as a parameter
    history.push(`/image/${image.id}`, { image });
  };

  return (
    <div>
      <h1>Images Page</h1>
      {images.map((data, index) => (
        <img
          key={index}
          alt="All Images"
          width={100}
          height={100}
          src={data.image}
          onClick={() => handleImageClick(data.image)}
        />
      ))}
    </div>
  );
}

export default ImagesPage;
